css:
.nuclide-filter-reminder {
  display: flex;
  flex-shrink: 0;
  font-style: italic;
  flex-wrap: wrap;
  padding: 5px;
}
.nuclide-filter-reminder,
.nuclide-filter-reminder pre {
  background-color: #282c34;
}
.nuclide-filter-reminder pre {
  padding: 0;
}
.nuclide-filter-reminder a {
  text-decoration: underline;
}
.nuclide-filter-reminder-message {
  flex: 1;
  margin-right: 1em;
}
